import React, {Component} from 'react';
import './App.css';
import Navigation from './components/Navigation/Navigation';
import {ClarifaiStub, grpc} from 'clarifai-nodejs-grpc';
import Logo from './components/Logo/Logo';
import Rank from './components/Rank/Rank';
import ImageLinkForm from './components/ImageLinkForm/ImageLinkForm';
import Particles from 'react-particles-js';
import ImageRecognition from './components/ImageRecognition/ImageRecognition';

const config = {
  "particles":{
    "number":{
      "value":80,
      "density":{
        "enable":true,
        "value_area":800
      }
    }
  }
}


const stub = ClarifaiStub.grpc();
// This will be used by every Clarifai endpoint call.
const metadata = new grpc.Metadata();
metadata.set("authorization", "Key {7ebc9459b3ef4a1da7ee52e6b32c58cb}");


class App extends Component {

  constructor () {
    super();

    this.state = {
      input: '',

    }
  }

   onInputChange = (event) => {
    this.setState({input: event.target.value});
    // console.log(event.target.value)
  }

  onButtonPress =(event) => {
    console.log('click')
    stub.PostModelOutputs(
    {
        // This is the model ID of a publicly available General model. You may use any other public or custom model ID.
        model_id: "aaa03c23b3724a16a56b629203edc62c",
        inputs: [{data: {image: {url: "https://samples.clarifai.com/dog2.jpeg"}}}]
    },
        metadata,
        (err, response) => {
            if (err) {
                console.log("Error: " + err);
                return;
            }

            if (response.status.code !== 10000) {
                console.log("Received failed status: " + response.status.description + "\n" + response.status.details);
                return;
            }

            console.log("Predicted concepts, with confidence values:")
            for (const c of response.outputs[0].data.concepts) {
                console.log(c.name + ": " + c.value);
            }
        }
    );
  }

  render () {
    return (
    <div className="App">
      <Particles className="particles" 
        params ={config}
      />
      <Navigation />
      <Logo />
      <Rank />
      <ImageLinkForm onInputChange={this.onInputChange} onButtonPress={this.onButtonPress}/>
      <ImageRecognition imageURL={this.state.input}/>

    </div>
    );
  }
}

export default App;
